var size = 1;
var procsize = 100;
var topl = 0;
$(".size_btn .min").click(function(){
    if(size > 0.1){
        size -= 0.1;
        procsize -= 10;
    }
    $("#rez_items").attr("style","transform: scale("+size+") ");
    $(".size").html(procsize+"%");

    return false;
});
$(".size_btn .pls").click(function(){
    if(size < 3){
        size += 0.1;
        procsize += 10;
    }
    $(".size").html(procsize+"%");
    $("#rez_items").attr("style","transform: scale("+size+")");
    return false;
});


