 $(".lock_item a").click(function(){
    var helpitem = this;
    $.ajax({
        url: $(helpitem).attr("href"),
        success: function(data){
            if(data == "True"){
                $(helpitem).attr("href",$(helpitem).attr("hline")+"True");
                $(helpitem).children("img").attr("src","/static/images/lock_item.png");
            }else{
                $(helpitem).attr("href",$(helpitem).attr("hline")+"False");
                $(helpitem).children("img").attr("src","/static/images/unlock_item.png");
            }
        }
    });
    return false;
 });

