function addToHistory(itemName){
    history.pushState(null, document.title, window.location.pathname);
    history.replaceState(null, document.title,  window.location.protocol+"//"+window.location.host + "" + window.location.pathname +"?modal_windows="+itemName);
}

window.addEventListener("popstate", function() {
    if($_GET("modal_windows") != false) {
        $.fancybox.close();
        openWindows($_GET("modal_windows"));
    }else{
        closeAll();
        //history.replaceState(null, document.title, window.location.protocol+"//"+window.location.host + "" + window.location.pathname);
    }
}, false);

$(document).ready(function() {
    if($_GET("modal_windows") != false) {
        openWindows($_GET("modal_windows"));
    }



});




function closeAll(){
    //Боковое меню
    $(".overlay").addClass("close");
    $(".overlay").removeClass("open");

    //
    $.fancybox.close();
}

function openWindows(item_name){
    if(item_name == "left_menu"){
        $(".overlay").addClass("open");
        $(".overlay").removeClass("close");
    }else{
        $.fancybox.open({
	        src  : "#"+item_name,
	        type : 'inline'
	    });
    }
  //window.location.reload()
}

function $_GET(key) {
    var p = window.location.search;
    p = p.match(new RegExp(key + '=([^&=]+)'));
    return p ? p[1] : false;
}




